import React from 'react';

const TrackingPage = () => {
  return (
    <div className="max-w-2xl mx-auto bg-white p-8 rounded-lg shadow-lg text-center">
      <h1 className="text-3xl font-bold mb-4">Track Your Shipment</h1>
      <p className="text-gray-600 mb-6">Enter your tracking number below to see the status of your shipment.</p>
      <div className="flex">
        <input 
          type="text" 
          placeholder="Enter tracking number (e.g., LS1234567890)" 
          className="w-full px-4 py-2 border rounded-l-md focus:outline-none focus:ring-2 focus:ring-blue-500"
        />
        <button className="px-6 py-2 bg-blue-600 text-white rounded-r-md hover:bg-blue-700">
          Track
        </button>
      </div>
    </div>
  );
};

export default TrackingPage;
